import './App.css';

function App() {
  return (
        <div className="App">
          <Switch>
        <Route component={ Component } exact path="/path" />
      </Switch>
          <Link to="/path">
            CLIQUE AQUI
          </Link>
        </div>
  );
}

export default App;
